import React from 'react'
import { GoogleMap , withScriptjs , withGoogleMap , Marker} from 'react-google-maps';
import markers from 'Utils/Maps/Markers';

const DefaultMap = () =>{
    return(
        <GoogleMap defaultZoom = {12} 
        defaultCenter = {{lat : 46.770920 , lng : 23.589920}}>
            {markers.map((currMarker) => {
                return(
                    <Marker key = {currMarker.key} position = {currMarker.position} icon = {currMarker.icon}/>
                );
            })}
        </GoogleMap>
    )
}

export default DefaultMap;
